Description:

Jenna is being lazy on the couch, flipping through the channels when her step mother Savannah comes in with the groceries. She orders Jenna to get off her butt and get on her homework. Jenna says it's already done so Savannah tells her to help out with other chores. They have a conversation about how school is going, and if her daughter is dating anyone, boys or girls. Jenna's somewhat embarrassed that her mom is asking her about what gender she's into ... (we know she likes girls..) Her mother states that she's been with many women before she met Jenna's dad. She feels that she has an obligation to her step daughter to show her the things she's learnt in the past. But we all know Jenna's in it for the sex.


